title: Mutual recursion in a chain of inheritance
description: >
  The defect manifests in the form of call chain cycles.
  The following cycles are present here:
  o6112.m25 -> o6112.m20 -> o6116.m28 -> o6112.m20
  o6112.m21 -> o6116.m28 -> o6112.m20 -> o6116.m28
  o6116.m28 -> o6112.m20 -> o6116.m28
  o6112.m20 -> o6116.m28 -> o6112.m20

features:
  - inheritance
  - overriding
  - method
  - polymorphism

